import React from 'react';
import { useState } from 'react';
import { useEffect } from 'react';
import './home.scss';


function HomePage() {




    return (
        <>


            <div id="home_content">
                <h1>Home</h1>
                <div className="images_container">
                    <div id="first_image">

                    </div>
                    <h1>Movies</h1>
                </div>
                <div className="images_container">
                    <h1>Actors</h1>
                </div>

            </div>



        </>




    );
}

export default HomePage;
